import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const HomePage = () => {
    return (
        <div className="min-h-screen flex flex-col">
            {/* Top menu with Login/Register */}
            <nav className="bg-gray-800 p-4">
                <div className="container mx-auto">
                    <div className="flex justify-between items-center">
                        <div className="text-white font-bold">
                            Devgree betax
                        </div>
                        <div className="space-x-4">
                            <a href="#" className="text-white">Login</a>
                            <a href="#" className="text-white">Register</a>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Banner section */}
            <header className="bg-blue-500 text-center py-16">
                <h1 className="text-white font-bold text-4xl">Welcome to Devgree</h1>
                <p className="text-white mt-4">Your one-stop solution for developer portfolios and job listings</p>
            </header>

            {/* Main section */}
            <main className="container mx-auto p-4">
                {/* Your main content goes here */}
                <p>Main content</p>
            </main>

            {/* Footer section */}
            <footer className="bg-gray-900 text-white py-8">
                <div className="container mx-auto">
                    <p>Footer content goes here</p>
                </div>
            </footer>

            {/* Copyright section */}
            <div className="bg-gray-800 text-center py-3">
                <p>&copy; 2023 Devgree. All rights reserved.</p>
            </div>
        </div>
    );
}

export default HomePage;
